CalcTest.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >0.5.0;
import "./MathLib.sol";

contract CalcTest {

    using ArrayLib for uint[];

    uint[] public data;

    //调用链接库中的乘法函数
    function mul(uint a, uint b) public pure returns (uint) {
        return MathLib.mul(a,b);
    }
    //using for 语法调用链接库中的函数
    function replace(uint _old, uint _new) public {
        uint result = data.findIndex(_old);
        if(result == uint(123456789)) {
            data.push(_new);
        } else{
            data[result] = _new;
        }
    }
}

MathLib.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >0.5.0;

library MathLib {
    //加法 内嵌库
    function sum(uint a, uint b) internal pure returns (uint) {
        return a + b;
    }
    //乘法  链接库
    function mul(uint a, uint b) external pure returns (uint) {
        return a * b;
    }
    //减法  内嵌库
    function sub(uint a, uint b) internal pure returns (uint) {
        return a - b;
    }
}


// contract Math {
//     //调用MathLib库的加法函数
//     function sum(uint a, uint b) public pure returns (uint) {
//         return MathLib.sum(a,b);
//     }
// }

library ArrayLib {
    function findIndex(uint[] storage a, uint value) external view returns (uint) {
        for (uint i = 0; i < a.length; ++i) {
            if(a[i] == value){
                return i;
            }
            
        } 
        return 123456789;
    }
}

